"use strict";(self.webpackChunkweslley_io=self.webpackChunkweslley_io||[]).push([[260],{7352:function(e){e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/2025/08/27/mvpconf-techtalk","metadata":{"permalink":"/talks/2025/08/27/mvpconf-techtalk","source":"@site/content/talks/2025/08/27/mvpconf-techtalk.mdx","title":"MVP Conf: Tech Talk","description":"Banner","date":"2025-08-27T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/talks/tags/online","description":"Online tag description"}],"readingTime":1,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"MVP Conf: Tech Talk","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1756963378000,"nextItem":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","permalink":"/talks/2025/08/21/each-usp"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83d\udcf9 **Palestra (Live):** GitHub al\xe9m do C\xf3digo: superando o mercado atrav\xe9s do open source\\n\\n:::note\\nVoltado para novos desenvolvedores, palestrei sobre o impacto que o open source e **GitHub** podem ter na nossa carreira, no programa **TechTalk** do canal [**MVP Conf**](https://www.youtube.com/@mvpconf), apresentado pela [**Vanessa Valle**](https://www.linkedin.com/in/vanessabrava/) e [**Renata Correa**](https://www.linkedin.com/in/correa-renata-ti/).\\n:::\\n\\n{/* truncate */}\\n\\nCom foco em como se destacar em um mercado cada vez mais competitivo, mostro como o open source pode avan\xe7ar sua evolu\xe7\xe3o t\xe9cnica, permitindo alcan\xe7ar conquistas inimagin\xe1veis que refletem diretamente na carreira profissional.\\n\\nEm um mercado cada vez mais competitivo, o open source n\xe3o \xe9 s\xf3 sobre c\xf3digo \u2014 \xe9 uma ponte direta para crescimento t\xe9cnico, visibilidade global e oportunidades reais na carreira.\\n\\nCom exemplos visuais, humanos e reais, quero te inspirar e trazer uma vis\xe3o cada vez mais otimista de si em um mundo cada vez mais intimidador, especialmente com a chegada das intelig\xeancias artificiais, usando o open source estrategicamente para construir credibilidade e confian\xe7a no mercado.\\n\\n:::tip\\n[Voc\xea pode reprisar a live no **YouTube** oficial do **MVP Conf** \u2728](https://www.youtube.com/watch?v=alfJ6aEJhhA)\\n:::"},{"id":"/2025/08/21/each-usp","metadata":{"permalink":"/talks/2025/08/21/each-usp","source":"@site/content/talks/2025/08/21/each-usp.mdx","title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","description":"Banner","date":"2025-08-21T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":1.03,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"MVP Conf: Tech Talk","permalink":"/talks/2025/08/27/mvpconf-techtalk"},"nextItem":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","permalink":"/talks/2025/08/09/oracle"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\nimport { SafeLink } from \'@site/src/components/SafeLink\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Keynote:** GitHub al\xe9m do C\xf3digo: superando o mercado atrav\xe9s do open source\\n\\n:::note\\nPalestrar em uma universidade (<SafeLink to=\\"https://www5.each.usp.br/\\">**USP**</SafeLink>), por si s\xf3 j\xe1 \xe9 especial, mas encerrar o dia de evento tornou tudo ainda mais especial \u2728\\n\\nO <SafeLink to=\\"https://www.semanadesi.com/\\">**SSI**</SafeLink> \xe9 um evento organizado pelos pr\xf3prios alunos da universidade e tive o prazer de ser convidado para ensinar atrav\xe9s do open source, usando o **GitHub** como ferramenta de estudo.\\n:::\\n\\n{/* truncate */}\\n\\nCom foco em como se destacar em um mercado cada vez mais competitivo, mostro como o open source pode avan\xe7ar sua evolu\xe7\xe3o t\xe9cnica, permitindo alcan\xe7ar conquistas inimagin\xe1veis que refletem diretamente na carreira profissional.\\n\\nEm um mercado cada vez mais competitivo, o open source n\xe3o \xe9 s\xf3 sobre c\xf3digo \u2014 \xe9 uma ponte direta para crescimento t\xe9cnico, visibilidade global e oportunidades reais na carreira.\\n\\nCom exemplos visuais, humanos e reais, quero te inspirar e trazer uma vis\xe3o cada vez mais otimista de si em um mundo cada vez mais intimidador, especialmente com a chegada das intelig\xeancias artificiais, usando o open source estrategicamente para construir credibilidade e confian\xe7a no mercado."},{"id":"/2025/08/09/oracle","metadata":{"permalink":"/talks/2025/08/09/oracle","source":"@site/content/talks/2025/08/09/oracle.mdx","title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","description":"Banner","date":"2025-08-09T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"}],"readingTime":0.67,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","authors":["wellwelwel"],"tags":["br","sp","sao-paulo"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"Semana de Sistemas de Informa\xe7\xe3o (EACH-USP)","permalink":"/talks/2025/08/21/each-usp"},"nextItem":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","permalink":"/talks/2025/07/19/codecon-summit"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Palestra:** Inventando o Novo: o ponto de encontro entre criatividade humana e gera\xe7\xe3o assistida por IA\\n\\n:::note\\nMelhorar performance em um sistema legado faz parte da rotina. Inventar algoritmos e uma nova arquitetura in\xe9dita \xe9 completamente diferente.\\n:::\\n\\n{/* truncate */}\\n\\nNesta palestra, eu compartilho os bastidores por tr\xe1s da reconstru\xe7\xe3o de uma biblioteca cr\xedtica do ecossistema open source, o **MySQL2**, para processar bilh\xf5es de requisi\xe7\xf5es **MySQL** de forma eficiente.\\n\\nVamos passar pelos problemas, ideias, implementa\xe7\xf5es, como ensinar **LLMs** a lidarem com algo novo e, inclusive, pela corre\xe7\xe3o de 4 vulnerabilidades (**CVEs**) cr\xedticas em larga escala.\\n\\nAl\xe9m disso, voc\xea vai conhecer como foi o processo de tornar o maior cliente **MySQL** para **JavaScript** compat\xedvel com **TypeScript**, **Bun**, **Deno** e **Cloudflare Workers**."},{"id":"/2025/07/19/codecon-summit","metadata":{"permalink":"/talks/2025/07/19/codecon-summit","source":"@site/content/talks/2025/07/19/codecon-summit.mdx","title":"Codecon Summit \u2014 Embrace the Hacker Way","description":"Banner","date":"2025-07-19T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"PR","permalink":"/talks/tags/pr","description":"PR tag description"},{"inline":false,"label":"Curitiba","permalink":"/talks/tags/curitiba","description":"Curitiba tag description"}],"readingTime":0.87,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","authors":["wellwelwel"],"tags":["br","pr","curitiba"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"DevConverge LATAM & Oracle \u2014 SPRINT SP","permalink":"/talks/2025/08/09/oracle"},"nextItem":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","permalink":"/talks/2025/06/14/winx-day"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Palestra:** Criando um Test Runner: O que acontece por tr\xe1s dos testes?\\n\\n:::note\\nMuito se discute sobre testes, mas como \xe9 criar um test runner do zero?<br />\\nMais que isso: como se testa um _test runner_?\\n:::\\n\\n{/* truncate */}\\n\\nNessa palestra, eu desmonto o Poku, o \xfanico _test runner_ brasileiro para **JavaScript** e **TypeScript**, que desafia mais de 14 anos da hist\xf3ria da linguagem, ao trazer a sintaxe nativa do **JavaScript** para os testes.\\n\\nVoc\xea vai aprender sobre o poder dos subprocessos, isolamento e as vantagens de trabalhar com concorr\xeancia. Tudo isso, usando somente recursos nativos da linguagem.\\n\\nCalma, sintaxe nativa?\\n\\nVoc\xea vai conhecer a hist\xf3ria dos testes para **JavaScript** e o motivo do por que testes n\xe3o seguem o fluxo natural da linguagem, enquanto descobre os bastidores dos _test runners_ mais populares da linguagem.\\n\\nEsse \xe9 o tipo de aprendizado que, independentemente de qual _tester_ voc\xea usa, vai mudar a maneira como voc\xea v\xea os testes de verdade."},{"id":"/2025/06/14/winx-day","metadata":{"permalink":"/talks/2025/06/14/winx-day","source":"@site/content/talks/2025/06/14/winx-day.mdx","title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","description":"Banner","date":"2025-06-14T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/talks/tags/online","description":"Online tag description"}],"readingTime":1.09,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"Codecon Summit \u2014 Embrace the Hacker Way","permalink":"/talks/2025/07/19/codecon-summit"},"nextItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/talks/2025/03/14/github-brasil"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Palestra (Live):** Superando a s\xedndrome do impostor e os desafios de existir no mercado atrav\xe9s do open source.\\n\\n:::note\\nUm evento online organizado pelo [**Luciano dii Souza**](https://www.linkedin.com/in/lucianodiisouza/), com uma abordagem descontra\xedda e realizado atrav\xe9s da comunidade do [**Discord**](https://discord.gg/wyrRdpGKmj) para a comunidade de desenvolvedores, com o objetivo de compartilhar experi\xeancias e conhecimentos, especialmente para quem est\xe1 iniciando na \xe1rea.\\n:::\\n\\n{/* truncate */}\\n\\nNesse momento em que muitos programadores se sentem inseguros sobre o futuro da \xe1rea:\\n\\n- Ser\xe1 que o meu n\xedvel \xe9 suficiente?\\n- Eu devo desistir se n\xe3o conseguir um emprego na minha \xe1rea?\\n- Como adquirir experi\xeancias se o mercado n\xe3o me d\xe1 oportunidades?\\n- Afinal, a Intelig\xeancia Artificial vai ou n\xe3o substituir os desenvolvedores?\\n\\nTrazer t\xf3picos sens\xedveis como inseguran\xe7a, complexo de inferioridade e autossabotagem, com uma luz no fim do t\xfanel atrav\xe9s da iniciativa open source, foi bem desafiador, mas muito interessante.\\n\\nEssa \xe9 uma palestra onde exponho as inseguran\xe7as durante minha trajet\xf3ria, conversando em um tom pr\xf3ximo ao que seria um desabafo.\\n\\nO intuito \xe9 me conectar com quem est\xe1 participando, evoluir para aprendizado e, quem sabe, inspirar atrav\xe9s da minha hist\xf3ria, compartilhando o lado humano que as redes sociais e os \\"t\xedtulos de LinkedIn\\" n\xe3o mostram."},{"id":"/2025/03/14/github-brasil","metadata":{"permalink":"/talks/2025/03/14/github-brasil","source":"@site/content/talks/2025/03/14/github-brasil.mdx","title":"GitHub Brasil \u2014 Open Source Friday","description":"Banner","date":"2025-03-14T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"Online","permalink":"/talks/tags/online","description":"Online tag description"}],"readingTime":1,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"GitHub Brasil \u2014 Open Source Friday","authors":["wellwelwel"],"tags":["br","online"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"Winx Day (Luciano dii Souza \u2014 O Primo Dev)","permalink":"/talks/2025/06/14/winx-day"},"nextItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83d\udcf9 **Palestra (Live):** Conhecendo o [**Poku**](https://github.com/wellwelwel/poku).\\n\\n:::note\\nEm um bate papo tanto t\xe9cnico, como casual, tive a honra de estrear a primeira edi\xe7\xe3o do **Open Source Friday** da [**GitHub Brasil**](https://www.linkedin.com/company/github-brazil), apresentado pela [**Pachi Parra**](https://www.linkedin.com/in/pachicodes/).\\n:::\\n\\n{/* truncate */}\\n\\nAo longo da live, pude contar um pouquinho sobre mim, a import\xe2ncia do _open source_, motiva\xe7\xf5es, desafios e planos futuros para o [Poku](https://github.com/wellwelwel/poku), al\xe9m de contar dicas maravilhosas para quem quer contribuir pela primeira vez, especialmente para quem se sente inseguro.\\n\\nEm 1 hora de live, teve desde conversas, microfone baixo _vs._ alto at\xe9 demais, explica\xe7\xf5es sobre sistemas de m\xf3dulos e a diferen\xe7a de comportamentos entre **Node.js**, **Bun** e **Deno**.\\n\\nTeve at\xe9 _live coding_ mostrando na pr\xe1tica por que outros _test runners_ n\xe3o s\xe3o compat\xedveis em totalidade com todos os executores de **JavaScript** no _backend_ e como o **Poku** desafia mais de 12 anos de hist\xf3ria da linguagem ao trazer o fluxo natural do **JavaScript** para os testes.\\n\\n:::tip\\n\\n[Voc\xea pode reprisar a live no **LinkedIn** oficial da **GitHub Brasil** \ud83d\udc37](https://www.linkedin.com/events/7305618122546294807/comments/)\\n\\n:::"},{"id":"/2024/11/23/devfest-cerrado-google-developer-groups","metadata":{"permalink":"/talks/2024/11/23/devfest-cerrado-google-developer-groups","source":"@site/content/talks/2024/11/23/devfest-cerrado-google-developer-groups.mdx","title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","description":"Banner","date":"2024-11-23T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"GO","permalink":"/talks/tags/go","description":"GO tag description"},{"inline":false,"label":"Goi\xe2nia","permalink":"/talks/tags/goiania","description":"Goi\xe2nia tag description"}],"readingTime":1.63,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","authors":["wellwelwel"],"tags":["br","go","goiania"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"GitHub Brasil \u2014 Open Source Friday","permalink":"/talks/2025/03/14/github-brasil"},"nextItem":{"title":"Microsoft Reactor e NodeBR","permalink":"/talks/2024/08/30/microsoft-reactor-e-nodebr"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.png)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Palestra:** Superando a s\xedndrome do impostor e os desafios de existir no mercado atrav\xe9s do open source.\\n\\n:::note\\nNesse momento em que muitos programadores se sentem inseguros sobre o futuro da \xe1rea, trazer t\xf3picos sens\xedveis como inseguran\xe7a, complexo de inferioridade e autossabotagem, com uma luz no fim do t\xfanel atrav\xe9s da iniciativa open source, foi bem desafiador, mas muito interessante:\\n:::\\n\\n{/* truncate */}\\n\\n## \ud83d\udca1 A escolha do tema\\n\\n- Ser\xe1 que o meu n\xedvel \xe9 suficiente?\\n- Eu devo desistir se n\xe3o conseguir um emprego na minha \xe1rea?\\n- Como adquirir experi\xeancias se o mercado n\xe3o me d\xe1 oportunidades?\\n\\n## \ud83e\uddd1\ud83c\udffb\u200d\ud83d\udd2c O desenvolvimento\\n\\nEu poderia facilmente explicar o que \xe9 s\xedndrome do impostor e ir direto para a \u201csolu\xe7\xe3o\u201d, mas optei pelo caminho mais dif\xedcil:\\n\\n\u2014 Expor minhas fraquezas durante minha trajet\xf3ria, conversando em um tom pr\xf3ximo ao que seria um desabafo.\\n\\nO intuito era me conectar com quem estivesse ali, evoluir para aprendizado e, quem sabe, inspirar atrav\xe9s da minha hist\xf3ria, compartilhando o lado humano que as redes sociais e os \\"t\xedtulos de LinkedIn\\" n\xe3o mostram.\\n\\n## \ud83d\udc7b Os desafios\\n\\nFalar sobre nossas falhas e inseguran\xe7as para pessoas que nem nos conhecem \xe9 mais complicado do que parece, as pessoas gostam de ouvir algu\xe9m que elas possam admirar.\\n\\nMas os coment\xe1rios e o carinho das pessoas que vieram falar comigo no final, me mostraram que a ideia de me conectar com quem estava ali n\xe3o s\xf3 deu certo, mas que realmente serviu de inspira\xe7\xe3o para algumas pessoas e isso me deixou muito feliz \u2728\\n\\n## \ud83c\udfa4 A palestra\\n\\nFiquei pensativo se as pessoas se interessariam por esse tema, mas aos poucos a sala foi ficando cheia e uma pessoa at\xe9 sentou no ch\xe3o no comecinho.\\n\\nOriginalmente, a apresenta\xe7\xe3o tinha alguns estudos complementares, incluindo telas pr\xe1ticas com contribui\xe7\xf5es open source reais, mas precisei adaptar algumas coisas pra caber no formato e tempo do evento.\\n\\n:::tip\\n\\nSpoiler (GIF) do slide utilizado na palestra:\\n\\n![Banner](./slide.gif)\\n\\n:::"},{"id":"/2024/08/30/microsoft-reactor-e-nodebr","metadata":{"permalink":"/talks/2024/08/30/microsoft-reactor-e-nodebr","source":"@site/content/talks/2024/08/30/microsoft-reactor-e-nodebr.mdx","title":"Microsoft Reactor e NodeBR","description":"Banner","date":"2024-08-30T00:00:00.000Z","tags":[{"inline":false,"label":"Brasil","permalink":"/talks/tags/br","description":"Brazil tag description"},{"inline":false,"label":"SP","permalink":"/talks/tags/sp","description":"SP tag description"},{"inline":false,"label":"S\xe3o Paulo","permalink":"/talks/tags/sao-paulo","description":"S\xe3o Paulo tag description"},{"inline":false,"label":"Online","permalink":"/talks/tags/online","description":"Online tag description"}],"readingTime":0.53,"hasTruncateMarker":true,"authors":[{"name":"Weslley Ara\xfajo","title":"Desenvolvedor ativo no ecossistema open source, co-mantenedor do MySQL2 e criador do Poku \u2728","url":"/","socials":{"linkedin":"https://www.linkedin.com/in/wellwelwel/","github":"https://github.com/wellwelwel","instagram":"https://www.instagram.com/wellwelwel","youtube":"https://youtube.com/@weslleyio"},"imageURL":"/img/avatar.png","key":"wellwelwel","page":null}],"frontMatter":{"title":"Microsoft Reactor e NodeBR","authors":["wellwelwel"],"tags":["br","sp","sao-paulo","online"]},"unlisted":false,"lastUpdatedAt":1756963378000,"prevItem":{"title":"DevFest Cerrado (Google Developer Groups \u2014 GDG)","permalink":"/talks/2024/11/23/devfest-cerrado-google-developer-groups"}},"content":"import { Parallax } from \'@site/src/components/Parallax\';\\n\\n<Parallax tiltMaxAngleX={0} perspective={1920}>\\n  ![Banner](./banner.jpeg)\\n</Parallax>\\n\\n\ud83c\udf99\ufe0f **Palestra:** Criando um Test Runner Multi-Plataforma de Alta Performance.\\n\\n:::note\\nO foco da palestra consistiu na import\xe2ncia de delegar as responsabilidades de cada problema usando recursos nativos do **Node.js**.\\n:::\\n\\n{/* truncate */}\\n\\nCom o tema \\"API Like a Boss\\", tive a oportunidade de ensinar atrav\xe9s do [**Poku**](https://github.com/wellwelwel/poku).\\n\\nAo inv\xe9s de apenas falar do Poku em si, tamb\xe9m usei o Poku como uma analogia, ensinando sobre sub-processos e diferen\xe7as entre **Node.js**, **Bun** e **Deno**.\\n\\n:::tip\\n\\n[Veja o slide utilizado na palestra \ud83d\udc37](https://drive.google.com/file/d/16XxIt_pov5aBidGjIwC4V_riYq3PMlrB/view)\\n\\n:::"}]}}')}}]);